import React from "react";
import { Link } from "react-router-dom";
import { ReactComponent as MyLogo } from "../../assets/skate.svg";
// this is a special syntax in React for importing SVG!!
// cool!
import "./header.styles.scss";
import { auth } from "../../firebase/firebase.utils";

const Header = ({ currentUser }) => {
  return (
    <div className="header">
      <Link className="logo-container" to="/">
        <MyLogo className="logo" />
      </Link>
      <div className="options">
        <Link className="option shop" to="/shop">
          Shop
        </Link>
        <Link className="option contact" to="/contact">
          Contact
        </Link>

        {currentUser ? (
          <div className="option signin" onClick={() => auth.signOut()}>
            Sign Out
          </div>
        ) : (
          <Link className="option" to="/signin">
            Sign In
          </Link>
        )}
      </div>
    </div>
  );
};

export default Header;
